import React from 'react'
import {food_list} from '../assets/frontend_assets/assets'
import ItemCard from './itemcard'
import { useFood } from '../context'

const FoodDisplay = () => {

    const { food } = useFood();

  return (
    <div>
        <div className='mb-5' ><h1 className='font-semibold text-4xl' >Top dishes near you</h1></div>
        <div className='grid grid-cols-4 gap-6' >
        {
        food_list.map((food) => {
                return(
                    <div key={food._id} className=''>
                        if( food.category === )
                        <ItemCard id={food._id} name={food.name} price={food.price} img={food.image} des={food.description} cat={food.category} />
                    </div>
                )
            })
        }    
        </div> 
    </div>
  )
}

export default FoodDisplay
